import pandas as pd
import math

department = ["sales","sales","sales","systems","systems","systems","systems","marketing","marketing","secretary","secretary"]
age = ["31_35","26_30","31_35","21_25","31_35","26_30","41_45","36_40","31_35","46_50","26_30"]
salary = ["46K_50K","26K_30K","31K_35K","46K_50K","66K_70K","46K_50K","66K_70K","46K_50K","41K_45K","36K_40K","26K_30K"]
status = ["senior","junior","junior","junior","senior","junior","senior","senior","junior","senior","junior"]
count = [30, 40, 40, 20, 5, 3, 3, 10, 4, 4, 6]

df = pd.DataFrame([department, age, salary, status, count]).T
df.columns = ['department', 'age', 'salary', 'status', 'count']
df

def calcEnt(df, trgt):
    total = sum(df['count'])
    ent = 0
    for uni in df[trgt].unique():
        p = sum(df.loc[df[trgt]==uni]['count'])/total
        ent += p * math.log2(p)
    return -ent
    
def calcGain(df, trgt, A):
    ent = calcEnt(df, trgt)
    total = sum(df['count'])
    toSub = 0

    for uni in df[A].unique():
        #for pos in df[trgt].unique():
        #    TVT = sum(df.loc[df[A]==uni].loc[df[trgt]==pos]['count'])/total
        TVT = sum(df.loc[df[A]==uni]['count'])/total
        split = df.loc[df[A]==uni]
        entV = calcEnt(split, trgt)
        toSub += (TVT * entV)
    return(ent-toSub)

def mostGain(df, trgt, feats):
    l = []
    for feat in feats:
        l.append(calcGain(df, 'status', feat))
    return(max(l), feats[l.index(max(l))])

feats = ['department', 'age', 'salary']
calcGain(df, 'status', 'department')
print(mostGain(df, 'status', feats))

splits = []
for uni in df['salary'].unique():
    splits.append(df.loc[df['salary']==uni])
splits

feats = ['department', 'age']

for split in splits:
    print(mostGain(split, 'status', feats))

